import WhatsApp from "./lib/components/ChatExtension";
import Logo from "./lib/components/avatardefault.jpg";
import "./App.css";

function App() {
  const accounts = [
    {
      name: "",
      position: "Example: Sales Support Unit",
      account: "98912*******",
      avatar: <img src={Logo} alt="" />,
      status: true,
    },    {
      name: "Example: Sales",
      position: "Example: Sales Support Unit",
      account: "98912*******",
      avatar: <img src={Logo} alt="" />,
      status: true,
    },
  ];

  return (
    <div>
      <p>Test whatsApp.</p>
      <WhatsApp
        tooltipTitle={"Do you have any questions about this product?"}
        tooltipDescription="Chat via WhatsApp"
        startChat={"start chat"}
        selectMember={"Choose one of the members and"}
        chatOnWhatsApp={"Please chat on WhatsApp"}
        titleDetails={"Responsive, usually respond in minutes."}
        accountList={accounts}
        // backgroundColor="green"

      />
      <WhatsApp
        dir="rtl"
        position="right"
        question={"در مورد این محصول سوالی دارید؟"}
        titleChat="چت از طریق واتس‌اپ"
        startChat={"شروع مکالمه"}
        chatOnWhatsApp={"لطفا در واتس‌اپ چت نمایید."}
        titleDetails={"پاسخگو،‌به طور معمول در چند دقیقه پاسخ می‌دهد"}
        selectMember={"لطفا یکی از اعضاء را انتخاب کنید و"}
        accountList={accounts}
        backgroundColor="red"
      />
    </div>
  );
}

export default App;

